import React from 'react';
import Header from "../header/Header";
import { Link } from 'react-router-dom';
import { LinkContainer } from 'react-router-bootstrap';
import { Card, Button } from "react-bootstrap";
import data from "./data";

export default function A() {
  return (
    <React.Fragment>
      <div style={{ backgroundColor: "black" }}>
        <Header />
        <LinkContainer to="/kali"> {/* Corrected the to attribute */}
          <div>
            <img src={require("../Images/kali.jpg").default} alt='kali mata' height={150} width={150} /> {/* Used .default for image import */}
            <figcaption> Kali </figcaption>
          </div>
        </LinkContainer>

        
        <div>
          {data?.map((X, index) => (
            <Card key={index} style={{ width: '16rem' }}>
              <Card.Img variant="top" src={X.src} />
              <Card.Body>
                <Card.Title>{X.title}</Card.Title>
                <Card.Text>
                  {X.author}
                </Card.Text>
              </Card.Body>
            </Card>
          ))}
        </div>
      </div>
    </React.Fragment>
  )
}
